// SPDX-License-Identifier: Unlicensed

import "./library/Context.sol";
import "./interface/IERC20.sol";
import "./library/Ownable.sol";
import "./library/SafeMath.sol";
import "./library/Address.sol";
import "./interface/IUniswapFactory.sol";
import "./interface/IUniswapRouter.sol";
import "./interface/IUniswapPair.sol";
// 1. buy fee: 10% => 3% in 2 weeks (14 days)
// 2. sell fee: 15% => 3% in 2 months (61 days)
// 3. Tax of buying amount of token more than current balance will be 10%.
// 4. Tax distribution: 48% is for rewards to holders. 48% is for adding liquidity automatically, 4% is for treasury
// 5. Buy back fee (in 2 hours) is 3%
// 6. Receiving from wallet will be treated as buy

contract PYRE is IERC20, Ownable {
    struct Transaction {
        uint time;
        uint256 amount;
    }

    enum Transaction_Type {
        SELL,
        BUY,
        TRANSFER
    }

    using SafeMath for uint256;
    using Address for address;

    mapping (address => uint256) private _rOwned;
    mapping (address => uint256) private _tOwned;
    mapping (address => mapping (address => uint256)) private _allowances;

    mapping (address => Transaction[]) public _buyTransactions;
    mapping (address => Transaction[]) public _sellTransactions;
    mapping (address => bool) private _isExcludedFromFee;

    mapping (address => bool) private _isExcluded;
    address[] private _excluded;
   
    uint256 private constant MAX = ~uint256(0);
    uint256 private _tTotal = 10**12 * 10**18; // 1T
    uint256 private _rTotal = (MAX - (MAX % _tTotal));
    uint256 private _tFeeTotal;

    string private _name = "PYRE";
    string private _symbol = "PYRE";
    uint8 private _decimals = 18;
    
    uint256 public _minFee = 300;                   // 3%
    uint256 public _buyFee = 1000;                  //10% Buy Fee
    uint256 public _sellFee = 1500;                 //15% Sell Fee

    uint256 public _sellFeeChangePeriod = 61 * 86400; // 2 months default
    uint256 public _buyFeeChangePeriod = 14 * 86400; // 2 weeks default
    uint256 public _buyBackPeriod = 2 * 3600; // 2 hr default


    uint256 public _taxFee = 48;                    // 48% of Total Fee
    uint256 public _liquidityFee = 48;             // 48% of Total Fee
    uint256 public _marketFee = 4;                 // 4% of Total Fee

    uint256 private _previousTaxFee = _taxFee;
    uint256 private _previousLiquidityFee = _liquidityFee;
    uint256 private _previousMarketFee = _marketFee;

    uint256 public totalDonated;
    address public CHARITY_WALLET;
    address private LIQUIDITY_HOLDER;

    uint public _totalBurned;

    uint256 public DROP_DIVISOR = 20;

    IUniswapV2Router02 public uniswapV2Router;
    address public uniswapV2Pair;
    
    bool inSwapAndLiquify = false;
    bool public swapAndLiquifyEnabled = true;

    uint256 private numTokensSellToAddToLiquidity = 1 * 10**6 * 10**18;
    address public constant BURN_ADDRESS = 0x000000000000000000000000000000000000dEaD;
    
    event MinTokensBeforeSwapUpdated(uint256 minTokensBeforeSwap);
    event SwapAndLiquifyEnabledUpdated(bool enabled);
    event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 ethReceived,
        uint256 tokensIntoLiqudity
    );
    
    modifier lockTheSwap {
        inSwapAndLiquify = true;
        _;
        inSwapAndLiquify = false;
    }
    
    constructor (address _charity, address _routerAddress) public {
        _rOwned[_msgSender()] = _rTotal.div(2);
        _rOwned[BURN_ADDRESS] = _rTotal.div(2);
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(_routerAddress); // V2 Router 
         // Create a uniswap pair for this new token
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), _uniswapV2Router.WETH());    

        // set the rest of the contract variables
        uniswapV2Router = _uniswapV2Router;
        
        //exclude owner and this contract from fee
        _isExcludedFromFee[owner()] = true;
        _isExcludedFromFee[address(this)] = true;

        CHARITY_WALLET = _charity;
        LIQUIDITY_HOLDER = address(this);
        
        emit Transfer(address(0), _msgSender(), _tTotal);
    }

    function setPair(address _uniswapV2Pair) public onlyOwner() { 
        uniswapV2Pair = _uniswapV2Pair;
    }

    function setLiqHolder(address liq_holder) public onlyOwner() { 
        LIQUIDITY_HOLDER = liq_holder;
    }

    function setRouter(address routerAddress) public onlyOwner() { 
        uniswapV2Router = IUniswapV2Router02(routerAddress);
    }

    function name() public view returns (string memory) {
        return _name;
    }


    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _tTotal;
    }

    function balanceOf(address account) public view override returns (uint256) {
        if (_isExcluded[account]) return _tOwned[account];
        return tokenFromReflection(_rOwned[account]);
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "ERC20: transfer amount exceeds allowance"));
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].add(addedValue));
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].sub(subtractedValue, "ERC20: decreased allowance below zero"));
        return true;
    }

    function isExcludedFromReward(address account) public view returns (bool) {
        return _isExcluded[account];
    }

    function totalFees() public view returns (uint256) {
        return _tFeeTotal;
    }

    function deliver(uint256 tAmount) public {
        address sender = _msgSender();
        require(!_isExcluded[sender], "Excluded addresses cannot call this function");
        (uint256 rAmount,,,) = _getValues(tAmount, Transaction_Type.TRANSFER, uniswapV2Pair);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _rTotal = _rTotal.sub(rAmount);
        _tFeeTotal = _tFeeTotal.add(tAmount);
    }

    function reflectionFromToken(uint256 tAmount, bool deductTransferFee) public returns(uint256) {
        require(tAmount <= _tTotal, "Amount must be less than supply");
        if (!deductTransferFee) {
            (uint256 rAmount,,,) = _getValues(tAmount, Transaction_Type.TRANSFER, uniswapV2Pair);
            return rAmount;
        } else {
            (,uint256 rTransferAmount,,) = _getValues(tAmount, Transaction_Type.TRANSFER, uniswapV2Pair);
            return rTransferAmount;
        }
    }

    function tokenFromReflection(uint256 rAmount) public view returns(uint256) {
        require(rAmount <= _rTotal, "Amount must be less than total reflections");
        uint256 currentRate =  _getRate();
        return rAmount.div(currentRate);
    }

    function excludeFromReward(address account) public onlyOwner() {
        // require(account != 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D, "We can not exclude Uniswap router.");
        require(!_isExcluded[account], "Account is already excluded");
        if(_rOwned[account] > 0) {
            _tOwned[account] = tokenFromReflection(_rOwned[account]);
        }
        _isExcluded[account] = true;
        _excluded.push(account);
    }

    function includeInReward(address account) external onlyOwner() {
        require(_isExcluded[account], "Account is already excluded");
        for (uint256 i = 0; i < _excluded.length; i++) {
            if (_excluded[i] == account) {
                _excluded[i] = _excluded[_excluded.length - 1];
                _tOwned[account] = 0;
                _isExcluded[account] = false;
                _excluded.pop();
                break;
            }
        }
    }
    
    function _transferBothExcluded(address sender, address recipient, uint256 tAmount, Transaction_Type tType) private {
        address _address = sender;
        
        if(tType == Transaction_Type.BUY)
            _address = recipient;
        
        (uint256 tTransferAmount, uint256 tFee, uint256 tLiquidity, uint256 tMarketing) = _getValues(tAmount, tType, _address);
        uint256 currentRate = _getRate();
        _tOwned[sender] = _tOwned[sender].sub(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(tAmount.mul(currentRate));
        _tOwned[recipient] = _tOwned[recipient].add(tTransferAmount);
        _rOwned[recipient] = _rOwned[recipient].add(tTransferAmount.mul(currentRate));        
        _tOwned[CHARITY_WALLET] = _tOwned[CHARITY_WALLET].add(tMarketing);
        _rOwned[CHARITY_WALLET] = _rOwned[CHARITY_WALLET].add(tMarketing.mul(currentRate));
        _takeLiquidity(tLiquidity);
        _reflectFee(tFee.mul(currentRate), tFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }
    
    function excludeFromFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = true;
    }
    
    function includeInFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = false;
    }
    
    function setMinFeePercent(uint256 minFee) external onlyOwner() {
        require(_minFee <= 300, "Fee too high");  // max buy fee of 10%
        _minFee = minFee;
    }

    function setBuyFeePercent(uint256 buyFee) external onlyOwner() {
        require(_buyFee <= 1000, "Fee too high");  // max buy fee of 10%
        _buyFee = buyFee;
    }
    
    function setSellFeePercent(uint256 sellFee) external onlyOwner() {
        require(sellFee <= 1500, "Fee too high");  // max tax fee of 15%
        _sellFee = sellFee;
    }
    
    function setTaxFeePercent(uint256 taxFee) external onlyOwner() {
        require(taxFee <= 50, "Fee too high");
        _taxFee = taxFee;
    }
    
    function setLiquidityFeePercent(uint256 liquidityFee) external onlyOwner() {
        require(liquidityFee <= 50, "Fee too high"); 
        _liquidityFee = liquidityFee;
    }

    function setSwapAndLiquifyEnabled(bool _enabled) public onlyOwner {
        swapAndLiquifyEnabled = _enabled;
        emit SwapAndLiquifyEnabledUpdated(_enabled);
    }
    
     //to recieve ETH from uniswapV2Router when swapping
    receive() external payable {}

    function _reflectFee(uint256 rFee, uint256 tFee) private {
        _rTotal = _rTotal.sub(rFee);
        _tFeeTotal = _tFeeTotal.add(tFee);
    }

    function _burn(address sender, uint tBurnAmount, uint rBurnAmount) private {
       if (_rOwned[address(sender)] <= rBurnAmount){
            _rOwned[address(sender)] = 0;
        } else { 
        _rOwned[address(sender)] -= rBurnAmount;
       }
        _tTotal = _tTotal.sub(tBurnAmount);
        _rTotal = _rTotal.sub(rBurnAmount);
        _totalBurned = _totalBurned.add(tBurnAmount);

        emit Transfer(sender, address(0), tBurnAmount);
    }
    
    function burn(uint amount) public returns(bool) {
        require(amount <= balanceOf(msg.sender), "insufficient amount");
        require(amount > 0, "must be greater than 0");
        
        uint _currentRate = _getRate();
        uint tBurnAmount = amount;
        uint rBurnAmount = tBurnAmount.mul(_currentRate);
        _burn(msg.sender, tBurnAmount, rBurnAmount);
        
        return true;
    }

    function _getValues(uint256 tAmount, Transaction_Type tType, address _address) private returns (uint256, uint256, uint256, uint256) {
        (uint256 tTransferAmount, uint256 tFee, uint256 tLiquidity, uint256 tMarketing) = _getTValues(tAmount, tType, _address);
        return (tTransferAmount, tFee, tLiquidity, tMarketing);
    }

    function _getTValues(uint256 tAmount, Transaction_Type tType, address _address) private returns (uint256, uint256, uint256, uint256) {
        uint256 _fee = _minFee;
        uint256 amount = tAmount;
       
        if(tType == Transaction_Type.SELL) //sell
        {
            _fee = _getSellFee(tAmount, _address);

        } else if (tType == Transaction_Type.BUY) // buy
        {
           _fee = _getBuyFee(tAmount, _address);
        }
        
        uint256 tFee = calculateTaxFee(tAmount, _fee);
        uint256 tLiquidity = calculateLiquidityFee(tAmount, _fee);
        uint256 tMarketing = calculateMarketingFee(tAmount, _fee);

        uint256 tTransferAmount = amount.sub(tFee).sub(tLiquidity).sub(tMarketing);

        return (tTransferAmount, tFee, tLiquidity, tMarketing);
    }

    function _getSellFee(uint amount, address _address) internal returns(uint256) {
        Transaction[] memory buyTrans = _buyTransactions[_address];
        uint256 tmpAmount = 0;
        uint256 totalFee = 0;
        uint length = buyTrans.length;
        uint _fee = _minFee;

        if (length > 0) {
            for(uint i = 0; i < length; i ++){
                if(tmpAmount >= amount)
                    break;

                uint256 val = 0;

                if((amount.sub(tmpAmount)) >= buyTrans[i].amount){
                    val = buyTrans[i].amount;
                    tmpAmount = tmpAmount + buyTrans[i].amount;
                    _buyTransactions[_address][i].amount = 0;
                }
                else {
                    val = amount.sub(tmpAmount);
                    tmpAmount = amount;
                    _buyTransactions[_address][i].amount = buyTrans[i].amount.sub(val);
                }

                if(now - buyTrans[i].time >= _sellFeeChangePeriod)
                    totalFee = totalFee + val.mul(_minFee);
                else
                    totalFee = totalFee + _getFeeAtPeriod(now - buyTrans[i].time, val, Transaction_Type.SELL);
            }
            if(tmpAmount < amount)
                totalFee = totalFee + (amount.sub(tmpAmount)).mul(_sellFee);
            _fee = totalFee.div(amount);
        } else {
            _fee = _sellFee;
        }
        
        return _fee;
    }

    function _getBuyFee(uint amount, address _address) internal returns(uint256) {
        uint256 _fee = _minFee;
        Transaction[] memory buyTrans = _buyTransactions[_address];
        uint256 _tAmount = amount;
        // process buyback in 2 hours
        uint _amount = _preProcessBuyBack(_address, amount);

        if (_amount >= amount) {
            _fee = _minFee;
            return _fee;
        }
        
        amount = amount.sub(_amount);
        
        uint totalFee = _amount.mul(_minFee);
        if (balanceOf(_address) < amount) {
            if (buyTrans.length > 0) {
                totalFee = totalFee +  _getFeeAtPeriod(now - buyTrans[0].time, balanceOf(_address), Transaction_Type.BUY);
                totalFee = totalFee + (amount.sub(balanceOf(_address))).mul(_buyFee);
            } else {
                totalFee = totalFee + amount.mul(_buyFee);
            }
            _fee = totalFee.div(_tAmount);
        } else {
            uint length = buyTrans.length;

            if (length > 0) {
                if (now - buyTrans[0].time < _buyFeeChangePeriod) {
                    totalFee = totalFee + _getFeeAtPeriod(now - buyTrans[0].time, amount, Transaction_Type.BUY);
                } else {
                    totalFee = totalFee + amount.mul(_minFee); 
                }
            } else {
                totalFee = totalFee +  amount.mul(_buyFee);
            }
            _fee = totalFee.div(_tAmount);
        }
        return _fee;
    }

    function _preProcessBuyBack(address _address, uint256 amount) internal returns(uint256) {
        Transaction[] memory sellTrans = _sellTransactions[_address];

        uint256 tmpAmount = 0;
        
        if (sellTrans.length > 0) {

            for (uint i = sellTrans.length; i > 0 ; i--) {
                uint j = i - 1;
                if(tmpAmount >= amount || (now - sellTrans[j].time > _buyBackPeriod))
                    break;
                
                if((amount.sub(tmpAmount)) >= sellTrans[j].amount){
                    tmpAmount = tmpAmount + sellTrans[j].amount;
                    _sellTransactions[_address][j].amount = 0;
                } else {
                    _sellTransactions[_address][j].amount = sellTrans[j].amount.sub((amount.sub(tmpAmount)));
                    tmpAmount = amount;
                }
            }
        }
        return tmpAmount;
    }

    function _getFeeAtPeriod(uint256 timeInterval, uint256 amount, Transaction_Type txType) internal view returns(uint) {
        uint256 fee = _minFee;
        if (txType == Transaction_Type.BUY) {
            if (timeInterval >= _buyFeeChangePeriod) {
                fee = amount.mul(_minFee);
            } else {
                fee = amount.mul(_buyFee.sub(timeInterval.mul(_buyFee - _minFee).div(_buyFeeChangePeriod))); 
            }
        } else if (txType == Transaction_Type.SELL) {
            if (timeInterval >= _sellFeeChangePeriod) {
                fee = amount.mul(_minFee);
            } else {
                fee = amount.mul(_sellFee.sub(timeInterval.mul(_sellFee - _minFee).div(_sellFeeChangePeriod))); 
            }
        }

        return fee;
    }

    function _getRate() private view returns(uint256) {
        (uint256 rSupply, uint256 tSupply) = _getCurrentSupply();
        return rSupply.div(tSupply);
    }

    function _getCurrentSupply() private view returns(uint256, uint256) {
        uint256 rSupply = _rTotal;
        uint256 tSupply = _tTotal;      
        for (uint256 i = 0; i < _excluded.length; i++) {
            if (_rOwned[_excluded[i]] > rSupply || _tOwned[_excluded[i]] > tSupply) return (_rTotal, _tTotal);
            rSupply = rSupply.sub(_rOwned[_excluded[i]]);
            tSupply = tSupply.sub(_tOwned[_excluded[i]]);
        }
        if (rSupply < _rTotal.div(_tTotal)) return (_rTotal, _tTotal);
        return (rSupply, tSupply);
    }
    
    function _takeLiquidity(uint256 tLiquidity) private {
        uint256 currentRate =  _getRate();
        uint256 rLiquidity = tLiquidity.mul(currentRate);
        _rOwned[address(this)] = _rOwned[address(this)].add(rLiquidity);
        if(_isExcluded[address(this)])
            _tOwned[address(this)] = _tOwned[address(this)].add(tLiquidity);
    }
    
    function calculateTaxFee(uint256 _amount, uint256 _fee) private view returns (uint256) {
        return _amount.mul(_fee).mul(_taxFee).div(
            1000000
        );
    }

    function calculateLiquidityFee(uint256 _amount, uint256 _fee) private view returns (uint256) {
        return _amount.mul(_fee).mul(_liquidityFee).div(
            1000000
        );    
    }
    
    function calculateMarketingFee(uint256 _amount, uint256 _fee) private view returns (uint256) {
        return _amount.mul(_fee).mul(_marketFee).div(
            1000000
        );    
    }
    
    function removeAllFee() private {
        if(_taxFee == 0 && _liquidityFee == 0 && _marketFee == 0) return;
        
        _previousTaxFee = _taxFee;
        _previousLiquidityFee = _liquidityFee;
        _previousMarketFee = _marketFee;
        
        _taxFee = 0;
        _liquidityFee = 0;
        _marketFee = 0;
    }
    
    function restoreAllFee() private {
        _taxFee = _previousTaxFee;
        _liquidityFee = _previousLiquidityFee;
        _marketFee = _previousMarketFee;
    }
    
    function isExcludedFromFee(address account) public view returns(bool) {
        return _isExcludedFromFee[account];
    }

    function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");

        uint256 currentSupply = totalSupply();

        if(to == uniswapV2Pair && !_isExcludedFromFee[from]){
            require(amount <= currentSupply.div(DROP_DIVISOR), "Sell amount too high bro"); // revert more than 5% of total supply
        }

        // if buying, assign sell cool-off block to buyer 
        if(!_isExcludedFromFee[to] || !_isExcludedFromFee[from]) {
            
        }

        // is the token balance of this contract address over the min number of
        // tokens that we need to initiate a swap + liquidity lock?
        // also, don"t get caught in a circular liquidity event.
        // also, don"t swap & liquify if sender is uniswap pair.
        uint256 contractTokenBalance = balanceOf(address(this));
        
        bool overMinTokenBalance = contractTokenBalance >= numTokensSellToAddToLiquidity;
        if (
            overMinTokenBalance &&
            !inSwapAndLiquify &&
            from != uniswapV2Pair &&
            swapAndLiquifyEnabled
        ) {
            contractTokenBalance = numTokensSellToAddToLiquidity;
            //add liquidity
            swapAndLiquify(contractTokenBalance);
        }

        //indicates if fee should be deducted from transfer
        bool takeFee = true;
        
        // if any account belongs to _isExcludedFromFee account then remove the fee
        // or min supply has been reached
        if(_isExcludedFromFee[from] || _isExcludedFromFee[to]) {
            takeFee = false;
        }

        //transfer amount, it will take tax, burn, liquidity fee
        _tokenTransfer(from,to,amount,takeFee);
    }

    function swapAndLiquify(uint256 contractTokenBalance) private lockTheSwap {
        // split the contract balance into halves
        uint256 half = contractTokenBalance.div(2);
        uint256 otherHalf = contractTokenBalance.sub(half);

        // capture the contract"s current ETH balance.
        // this is so that we can capture exactly the amount of ETH that the
        // swap creates, and not make the liquidity event include any ETH that
        // has been manually sent to the contract
        uint256 initialBalance = address(this).balance;

        // swap tokens for ETH
        swapTokensForEth(half);

        // how much ETH did we just swap into?
        uint256 newBalance = address(this).balance.sub(initialBalance);

        // add liquidity to uniswap
        addLiquidity(otherHalf, newBalance);
        
        emit SwapAndLiquify(half, newBalance, otherHalf);
    }

    function swapTokensForEth(uint256 tokenAmount) private {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // make the swap
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            address(this),
            block.timestamp
        );
    }

    function addLiquidity(uint256 tokenAmount, uint256 ethAmount) private {
        // approve token transfer to cover all possible scenarios
        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // add the liquidity
        uniswapV2Router.addLiquidityETH{value: ethAmount}(
            address(this),
            tokenAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            LIQUIDITY_HOLDER,
            block.timestamp
        );
    }

    //this method is responsible for taking all fee, if takeFee is true
    function _tokenTransfer(address sender, address recipient, uint256 amount, bool takeFee) private {
        if(!takeFee)
            removeAllFee();

        Transaction_Type transferType = Transaction_Type.TRANSFER;

        if (recipient == uniswapV2Pair) {
            transferType = Transaction_Type.SELL;
        } else if (sender == uniswapV2Pair) {
            transferType = Transaction_Type.BUY;
        }

        if (_isExcluded[sender] && !_isExcluded[recipient]) {

            _transferFromExcluded(sender, recipient, amount, transferType);    

        } else if (!_isExcluded[sender] && _isExcluded[recipient]) {

            _transferToExcluded(sender, recipient, amount, transferType);  

        } else if (!_isExcluded[sender] && !_isExcluded[recipient]) {

            _transferStandard(sender, recipient, amount, transferType);   

        } else if (_isExcluded[sender] && _isExcluded[recipient]) {

            _transferBothExcluded(sender, recipient, amount, transferType);
                
        } else {

            _transferStandard(sender, recipient, amount, transferType);    
            
        }
        
        if(recipient == uniswapV2Pair)
        {
            _sellTransactions[sender].push(Transaction(now, amount));
        }
        else if(sender == uniswapV2Pair){
            _buyTransactions[recipient].push(Transaction(now, amount));
        } else {
            _buyTransactions[recipient].push(Transaction(now, amount));
        }
        
        if(!takeFee)
            restoreAllFee();
    }

    function _transferStandard(address sender, address recipient, uint256 tAmount, Transaction_Type tType) private {
        address _address = sender;
        if(tType == Transaction_Type.BUY)
            _address = recipient;
        
        (uint256 tTransferAmount, uint256 tFee, uint256 tLiquidity, uint256 tMarketing) = _getValues(tAmount, tType, _address);
        uint256 currentRate =  _getRate();

        _rOwned[sender] = _rOwned[sender].sub(tAmount.mul(currentRate));
        _rOwned[recipient] = _rOwned[recipient].add(tTransferAmount.mul(currentRate));
        
        _rOwned[CHARITY_WALLET] = _rOwned[CHARITY_WALLET].add(tMarketing.mul(currentRate));
        _takeLiquidity(tLiquidity);
        _reflectFee(tFee.mul(currentRate), tFee);

        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _transferToExcluded(address sender, address recipient, uint256 tAmount, Transaction_Type tType) private {
        address _address = sender;
        
        if(tType == Transaction_Type.BUY)
            _address = recipient;
        
        (uint256 tTransferAmount, uint256 tFee, uint256 tLiquidity, uint256 tMarketing) = _getValues(tAmount, tType, _address);
        uint256 currentRate = _getRate();
        _rOwned[sender] = _rOwned[sender].sub(tAmount.mul(currentRate));
        _tOwned[recipient] = _tOwned[recipient].add(tTransferAmount);
        _rOwned[recipient] = _rOwned[recipient].add(tTransferAmount.mul(currentRate));

        _rOwned[CHARITY_WALLET] = _rOwned[CHARITY_WALLET].add(tMarketing.mul(currentRate));
        _takeLiquidity(tLiquidity);
        _reflectFee(tFee.mul(currentRate), tFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _transferFromExcluded(address sender, address recipient, uint256 tAmount, Transaction_Type tType) private {
        //0: sell
        //1: buy
        //2: transfer
        address _address = sender;
        
        if(tType == Transaction_Type.BUY)
            _address = recipient;
        
        (uint256 tTransferAmount, uint256 tFee, uint256 tLiquidity, uint256 tMarketing) = _getValues(tAmount, tType, _address);
        uint256 currentRate = _getRate();
        _tOwned[sender] = _tOwned[sender].sub(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(tAmount.mul(currentRate));
        _rOwned[recipient] = _rOwned[recipient].add(tTransferAmount.mul(currentRate));   

        _rOwned[CHARITY_WALLET] = _rOwned[CHARITY_WALLET].add(tMarketing.mul(currentRate));
        _takeLiquidity(tLiquidity);
        _reflectFee(tFee.mul(currentRate), tFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function setLiquifyAmount(uint256 amount) public onlyOwner {
        numTokensSellToAddToLiquidity = amount;
    }
    
    function setMarketFee(uint256 amount) public onlyOwner {
        _marketFee = amount;
    }

    function setDropDivisor(uint256 _DROP_DIVISOR) public onlyOwner {
        require(_DROP_DIVISOR > 0,"need: divvies with privvies");
        DROP_DIVISOR = _DROP_DIVISOR;
    }

    function setCharityWallet(address _charityWallet) public onlyOwner {
        CHARITY_WALLET = _charityWallet;
    }

    function withdrawAnyToken(address _recipient, address _ERC20address, uint256 _amount) public onlyOwner returns(bool) {
        require(_ERC20address != uniswapV2Pair, "Can't transfer out LP tokens!");
        require(_ERC20address != address(this), "Can't transfer out contract tokens!");
        IERC20(_ERC20address).transfer(_recipient, _amount); //use of the _ERC20 traditional transfer
        return true;
    }

    function transferXS(address payable recipient) public onlyOwner {
        recipient.transfer(address(this).balance);
    }
}
